class Main extends React.Component{
    render(){
        return(
            <>
                <div>
                    <img src="https://i.postimg.cc/L8QqR4r1/money-bag.png" id="image2position" alt="" ></img>
                </div>
                <div>
                    <img src="https://i.postimg.cc/mrLXHjD9/favicontrain.png" id="imageposition" alt="" ></img>
                </div>
            </>
            
        )
    }
}
export default Main;
